import React from 'react'
import Sidebar from "../../components/Sidebar";

function Homestay() {
    return (
      <div className='flex h-screen'>
        <Sidebar />
        <main className='flex-1 p-8'>
          <h2 className='text-2xl font-semibold'>Homestay Management</h2>
          <p className='mt-4 text-gray-600'>Manage your homestay listings here.</p>
        </main>
      </div>
    );
  }

export default Homestay
